import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <div>
      <header>
          okay
      </header>
        <Router>
            <Routes>
                <Route path="/" element={
                    <Game
                    />}/>
                <Route path="/settings" element={
                    <Settings
                    />}/>
                <Route path="/stats" element={
                    <Stats
                    />} />
            </Routes>
        </Router>
    </div>
  );
}

export default App;
